import { ButtonCalculator } from "./Styles"

const Button = () => {
  return (
    <div>
      <ButtonCalculator>1</ButtonCalculator>
      <ButtonCalculator>2</ButtonCalculator>
      <ButtonCalculator>3</ButtonCalculator>
      <ButtonCalculator>4</ButtonCalculator>
    </div>

  )
}

export default Button
